import React, {useEffect, useState} from "react";

import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import {faClock} from "@fortawesome/free-solid-svg-icons";
import LinearProgress from "@mui/material/LinearProgress";
import {CircularProgress} from "@mui/material";


function WoodBlock(props) {
    function toggle() {
        setOn(prevOn => !prevOn)
    }
    const [on, setOn] = React.useState(true)
    const [progress, setProgress] = useState(0);
    useEffect(() => {
        const interval = setInterval(() => {
            setProgress((prevProgress) => {
                if (prevProgress >= 100) {
                    return 0; // Reset progress bar
                } else {
                    return prevProgress + 1; // Increment progress value
                }
            });
        }, 5);

        return () => clearInterval(interval); // Cleanup function to clear the interval
    }, []);
    console.log(on)
    return (
        <div className={"prof-block pointer "} onClick={toggle}>

            <br/>
            <small>Cut</small>
            <br/>
            <span>{props.title}</span>
            <br/>
            <small>
                <span>{props.xp} XP</span>
                /
                <span><FontAwesomeIcon icon={faClock} /> </span>
                <span>{props.cutTime} seconds</span>
            </small>
            <br/>
            <img src={props.img} width="65px"></img>
            <br/>
            <CircularProgress />
            </div>

    );
}

export default WoodBlock;
